import React from "react";

class Restaurant extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      mealTime: props.mealTime,
      restaurant_id: props.restaurant_id,
    };
  }

  render() {
    return (
      <div>
        <h1>Meal Time</h1>
      </div>
    );
  }
}

export default Restaurant;
